import React from 'react';
import { View, Text, StyleSheet, Image, TouchableOpacity, TextInput } from 'react-native'; // Importa TextInput
import { NativeStackNavigationProp } from '@react-navigation/native-stack';
import { useNavigation } from '@react-navigation/native';

type ScreenNames = 'SignIn' | 'SignUp';

type NavigationProp = NativeStackNavigationProp<{
  SignIn: undefined;
  SignUp: undefined;
}>;

interface UserInput {
  email: string;
  password: string;
}

const Home = () => {
  const navigation = useNavigation<NavigationProp>();
  const [userInput, setUserInput] = React.useState<UserInput>({
    email: '',
    password: '',
  });

  const goToScreen = (screenName: ScreenNames) => {
    navigation.navigate(screenName);
  };

  const handleChange = (name: keyof UserInput, value: string) => {
    setUserInput((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <View style={styles.container}>
      <Image source={require('../images/shaba.png')} style={styles.logo} />
      <Text style={styles.title}>Welcome to SHABA!</Text>
      <TextInput
        style={styles.input}
        placeholder="Email"
        keyboardType="email-address"
        autoCapitalize="none"
        onChangeText={(text) => handleChange('email', text)}
        value={userInput.email}
      />
      <TextInput
        style={styles.input}
        placeholder="Password"
        secureTextEntry={true}
        onChangeText={(text) => handleChange('password', text)}
        value={userInput.password}
      />
      <TouchableOpacity style={styles.socialButton}>
        <Image source={require('../images/google.png')} style={styles.socialIcon} />
        <Text style={styles.socialButtonText}>Login with Google</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.socialButton}>
        <Image source={require('../images/facebook.png')} style={styles.socialIcon} />
        <Text style={styles.socialButtonText}>Login with Facebook</Text>
      </TouchableOpacity>
      <View style={styles.checkboxContainer}>
        {/* Aquí debes importar Checkbox si no lo has hecho */}
        //<Checkbox style={styles.checkbox} disabled={false} value="agree" />
        <Text style={styles.termsText}>I agree to all terms and conditions</Text>
      </View>
      <TouchableOpacity style={styles.button} onPress={() => goToScreen('SignIn')}>
        <Text style={styles.buttonText}>Sign In</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 150,
    height: 150,
    marginBottom: 20,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 30,
  },
  input: {
    width: '80%',
    padding: 15,
    marginBottom: 10,
    borderRadius: 5,
    backgroundColor: '#f5f5f5',
  },
  socialButton: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    width: '80%',
    padding: 15,
    marginBottom: 10,
    borderRadius: 5,
    backgroundColor: '#f0f0f0',
  },
  socialIcon: {
    marginRight: 10,
  },
  socialButtonText: {
    fontSize: 16,
  },
  checkboxContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 10,
  },
  checkbox: {
    marginRight: 10,
  },
  termsText: {
  },
  button: {
    backgroundColor: '#4CAF50',
    width: '50%',
    padding: 15,
    borderRadius: 5,
    alignItems: 'center',
    marginBottom: 10,
  },
  buttonText: {
    color: '#fff',
    fontSize: 18,
  },
});

export default Home;
